const e=JSON.parse('{"key":"v-7ffa5ca6","path":"/linux/command/command.html","title":"基本格式","lang":"zh-CN","frontmatter":{"title":"基本格式","icon":"shell","date":"2019-11-18T00:00:00.000Z","category":["Linux"],"description":"命令提示符 登录系统后，第一眼看到的内容是: [root@localhost ~]# 这就是 Linux 系统的命令提示符。那么，这个提示符的含义是什么呢? []: 这是提示符的分隔符号，没有特殊含义。 root: 显示的是当前的登录用户，笔者现在使用的是 root 用户登录。 @: 分隔符号，没有特殊含义。 localhost: 当前系统的简写主机名(完整主机名是 localhost.localdomain)。 ~: 代表用户当前所在的目录，此例中用户当前所在的目录是家目录。 #: 命令提示符，Linux 用这个符号标识登录的用户权限等级。如果是超级用户，提示符就是 #；如果是普通用户，提示符就是 $。","head":[["meta",{"property":"og:url","content":"https://mrhope.site/linux/command/command.html"}],["meta",{"property":"og:site_name","content":"Mr.Hope"}],["meta",{"property":"og:title","content":"基本格式"}],["meta",{"property":"og:description","content":"命令提示符 登录系统后，第一眼看到的内容是: [root@localhost ~]# 这就是 Linux 系统的命令提示符。那么，这个提示符的含义是什么呢? []: 这是提示符的分隔符号，没有特殊含义。 root: 显示的是当前的登录用户，笔者现在使用的是 root 用户登录。 @: 分隔符号，没有特殊含义。 localhost: 当前系统的简写主机名(完整主机名是 localhost.localdomain)。 ~: 代表用户当前所在的目录，此例中用户当前所在的目录是家目录。 #: 命令提示符，Linux 用这个符号标识登录的用户权限等级。如果是超级用户，提示符就是 #；如果是普通用户，提示符就是 $。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2022-02-06T16:46:58.000Z"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:published_time","content":"2019-11-18T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2022-02-06T16:46:58.000Z"}]]},"headers":[{"level":2,"title":"命令提示符","slug":"命令提示符","link":"#命令提示符","children":[]},{"level":2,"title":"命令的基本格式","slug":"命令的基本格式","link":"#命令的基本格式","children":[]}],"git":{"createdTime":1591204114000,"updatedTime":1644166018000,"contributors":[{"name":"Mr.Hope","email":"zhangbowang1998@gmail.com","commits":6}]},"readingTime":{"minutes":3.26,"words":978},"localizedDate":"2019年11月18日","filePathRelative":"linux/command/command.md","excerpt":"<h2> 命令提示符</h2>\\n<p>登录系统后，第一眼看到的内容是:</p>\\n<div class=\\"language-shell-session\\" data-ext=\\"shell-session\\"><pre class=\\"language-shell-session\\"><code><span class=\\"token output\\">[root@localhost ~]#\\n</span></code></pre></div><p>这就是 Linux 系统的命令提示符。那么，这个提示符的含义是什么呢?</p>\\n<ul>\\n<li><code>[]</code>: 这是提示符的分隔符号，没有特殊含义。</li>\\n<li><code>root</code>: 显示的是当前的登录用户，笔者现在使用的是 root 用户登录。</li>\\n<li><code>@</code>: 分隔符号，没有特殊含义。</li>\\n<li><code>localhost</code>: 当前系统的简写主机名(完整主机名是 <code>localhost.localdomain</code>)。</li>\\n<li><code>~</code>: 代表用户当前所在的目录，此例中用户当前所在的目录是家目录。</li>\\n<li><code>#</code>: 命令提示符，Linux 用这个符号标识登录的用户权限等级。如果是超级用户，提示符就是 <code>#</code>；如果是普通用户，提示符就是 <code>$</code>。</li>\\n</ul>","autoDesc":true}');export{e as data};
